import ReactDOM from "react-dom";
import {Routes, Route, useNavigate} from 'react-router-dom'

const Navbar = () => {
  const navigate = useNavigate();

  const navigateToCreate = () => {
    navigate('/create');
  };

  const navigateHome = () => {
    navigate('/');
  };
  return (
    <nav className="navbar">
      <h1>SNEAKLIST</h1>
      <div className="links">
        <a href="/">Home </a>
        <a href="/create">New Shoe</a>
      </div>
    </nav>
  );
};

export default Navbar;
